import turtle


screen = turtle.Screen()
screen.getcanvas().winfo_toplevel().state('zoomed')

screen.setup(width=800, height=600)

screen.bgpic("001.png")

screen.addshape("steve.gif")


exit_image = "exit.gif" 
screen.addshape(exit_image)



steve = turtle.Turtle()

steve.shape("steve.gif")

steve.width(10)

steve.color("yellow")


exit_x, exit_y = -420, 200 
exit_radius = 50 


def check_exit_reached():
    
    current_x, current_y = steve.position()
    distance = ((current_x - exit_x)**2 + (current_y - exit_y)**2)**0.5
    
    if distance < exit_radius:
      
      
        congratulations = turtle.Turtle()
        congratulations.hideturtle()
        congratulations.penup()
        congratulations.shape(exit_image)
        congratulations.goto(0, 0)
        congratulations.showturtle()
        
       
        screen.title("Congratulations! You completed the maze!")


def move_and_check(distance):
    steve.forward(distance)
    check_exit_reached()



steve.penup()
steve.goto(390, 250)

steve.pendown()




